from collections import Counter
s = ""
k = 50436
# k = 274
def test(s,k):
        vows = 'aeiou'
        A = []
        for c in s:
            v = c in vows
            A.append(1 if v else 0)
        P = [0]
        for x in A:
            P.append(P[-1] + x)
        
        ans = 0
        for i in range(len(P)):
            j = i + kb
            if j >= len(P): break
            ans = max(ans, P[j] - P[i])
        return ans
print(test(s,k))